import React from "react";
import {Table,Pagination} from "antd";

function contest() {
    const columns = [
        { title: 'Name', dataIndex: 'name', key: 'name' },
        { title: 'Time', dataIndex: 'time', key: 'time' },
        { title: 'Content', dataIndex: 'content', key: 'content' },
    ];

    const data = [
        {
            key: 1,
            name: 'John Brown',
            time: '2021 17:28:46',
            content: 'New York No. 1 Lake Park',
        },
        {
            key: 2,
            name: 'Jim Green',
            time: '2021 17:28:46',
            content: 'London No. 1 Lake Park',
        },
        {
            key: 3,
            name: 'Not Expandable',
            time: '2021 17:28:46',
            content: 'Jiangsu No. 1 Lake Park',
        },
    ];

    return(
        <div>
            <Table
                columns={columns}
                dataSource={data}
            />
            <Pagination  total={50} />
        </div>
    )
}
export default contest
